import React from "react"
import data from "../Data"
import {Link, useMatch} from "react-router-dom"

export default function Aulas(props){
    // const match = useMatch();
    return (
        <div className="page">
            <h1>Aulas</h1>
            <ul className="aulas">
                {data.map(aula =>
                    <li key={aula.id}><Link to={`/${aula.id}`}>{aula.title}</Link></li>
                    )}
            </ul>
        </div>
    )
}
